import React, { useState } from "react";
import {
  FaMapMarkedAlt,
  FaRoute,
  FaChartLine,
  FaHotel,
  FaInfoCircle,
} from "react-icons/fa";

// Import components
import Map from "./components/Map";
import Recommendations from "./components/Recommendations";
import Predictions from "./components/Predictions";

function App() {
  // State
  const [currentRoute, setCurrentRoute] = useState(null);
  const [sourceLocation, setSourceLocation] = useState(null);
  const [destinationLocation, setDestinationLocation] = useState(null);
  const [prediction, setPrediction] = useState(null);
  const [activeTab, setActiveTab] = useState(0);

  // Handle route calculation
  const handleRouteCalculated = (source, destination, route) => {
    setSourceLocation(source);
    setDestinationLocation(destination);
    setCurrentRoute(route);
  };

  // Handle prediction complete
  const handlePredictionComplete = (pred) => {
    setPrediction(pred);
  };

  // Tab switching
  const handleTabClick = (index) => {
    setActiveTab(index);
  };

  return (
    <div className="min-h-screen bg-gray-50">
      {/* App Header */}
      <header className="flex items-center justify-between flex-wrap p-4 bg-teal-500 text-white">
        <div className="flex items-center mr-5">
          <FaRoute size={30} />
          <h1 className="text-2xl font-bold ml-2">Traveler Guide System</h1>
        </div>

        <p className="text-sm md:text-base">
          Optimal routes, predictions, and recommendations for travelers
        </p>
      </header>

      {/* Tabs Navigation */}
      <div className="mt-4">
        <div className="flex border-b border-gray-200">
          <button
            className={`px-4 py-2 flex items-center ${
              activeTab === 0
                ? "border-b-2 border-teal-500 text-teal-600 font-medium"
                : "text-gray-600 hover:text-teal-500"
            }`}
            onClick={() => handleTabClick(0)}
          >
            <FaMapMarkedAlt className="mr-2" /> Map
          </button>
          <button
            className={`px-4 py-2 flex items-center ${
              activeTab === 1
                ? "border-b-2 border-teal-500 text-teal-600 font-medium"
                : "text-gray-600 hover:text-teal-500"
            }`}
            onClick={() => handleTabClick(1)}
          >
            <FaChartLine className="mr-2" /> Predictions
          </button>
          <button
            className={`px-4 py-2 flex items-center ${
              activeTab === 2
                ? "border-b-2 border-teal-500 text-teal-600 font-medium"
                : "text-gray-600 hover:text-teal-500"
            }`}
            onClick={() => handleTabClick(2)}
          >
            <FaHotel className="mr-2" /> Recommendations
          </button>
          <button
            className={`px-4 py-2 flex items-center ${
              activeTab === 3
                ? "border-b-2 border-teal-500 text-teal-600 font-medium"
                : "text-gray-600 hover:text-teal-500"
            }`}
            onClick={() => handleTabClick(3)}
          >
            <FaInfoCircle className="mr-2" /> About
          </button>
        </div>

        {/* Tab Content */}
        <div className="mt-4">
          {/* Map Tab */}
          {activeTab === 0 && (
            <div className="p-0">
              <Map onRouteCalculated={handleRouteCalculated} />
            </div>
          )}

          {/* Predictions Tab */}
          {activeTab === 1 && (
            <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
              <Predictions
                source={sourceLocation}
                destination={destinationLocation}
                onPredictionComplete={handlePredictionComplete}
              />
            </div>
          )}

          {/* Recommendations Tab */}
          {activeTab === 2 && (
            <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
              <Recommendations
                userLocation={sourceLocation}
                route={currentRoute}
              />
            </div>
          )}

          {/* About Tab */}
          {activeTab === 3 && (
            <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
              <div className="p-5 shadow-md border border-gray-200 rounded-lg bg-white">
                <h2 className="text-2xl font-bold mb-4">
                  About the Traveler Guide System
                </h2>

                <p className="text-lg mb-4">
                  Traveler Guide is a comprehensive application designed to help
                  travelers plan their journeys with intelligent routing,
                  accurate travel time predictions, and personalized
                  recommendations.
                </p>

                <h3 className="text-xl font-semibold mb-3 mt-6">
                  Key Features
                </h3>

                <div className="pl-4 mb-6">
                  <p className="mb-2">
                    • Interactive Google Maps with route visualization
                  </p>
                  <p className="mb-2">
                    • Optimal route calculation using Dijkstra's and A*
                    algorithms
                  </p>
                  <p className="mb-2">
                    • ML-based travel time and traffic predictions
                  </p>
                  <p className="mb-2">
                    • Place recommendations (hotels, restaurants, gas stations)
                    using K-Means clustering
                  </p>
                  <p className="mb-2">
                    • Route preferences (no tolls, shortest, safest, scenic)
                  </p>
                  <p className="mb-2">• Offline route saving capabilities</p>
                </div>

                <h3 className="text-xl font-semibold mb-3">Technology Stack</h3>

                <div className="pl-4 mb-6">
                  <p className="mb-2">
                    • Frontend: React.js with Google Maps JavaScript API,
                    Tailwind CSS
                  </p>
                  <p className="mb-2">• Backend: Node.js with Express</p>
                  <p className="mb-2">
                    • ML Models: Python with scikit-learn and TensorFlow
                  </p>
                  <p className="mb-2">• Database: MongoDB</p>
                </div>

                <p className="text-sm text-gray-600 mt-8">
                  Developed as a demonstration of full-stack development and
                  machine learning integration.
                </p>
              </div>
            </div>
          )}
        </div>
      </div>
    </div>
  );
}

export default App;
